{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) చిన్నంపేట | city = చినమ్పేట , కృష్ణ | district = కృష్ణ | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = తెలుగు, ఇంగ్లీష్ | studnets = 318 మంది | faculty = పధ్నాలుగు మంది }}
కృష్ణ జిల్లాలో చాట్ రాయ్ పరిధిలో చినమ్పేట గ్రామం నందు ఈ పాఠశాల ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28162400403. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యాబోధన కలదు. ఇక్కడ తెలుగు, ఇంగ్లీష్ మాధ్యమంలో పాఠాలు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. ఈ పాఠశాల లో మొత్తం 318 మంది విద్యార్థులు చదువుతున్నారు. వీరిలో 160 మంది బాలురు 158 మంది బాలికలు ఉన్నారు. మొత్తం పధ్నాలుగు మంది ఉపాధ్యాయులు ఆరుగురు ఉపాధ్యాయులు ఎనిమిది మంది ఉపాధ్యాయినులు ఇక్కడ ఉన్నారు. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
