{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) డి రాజావ రి పల్లె | city = సెట్టిపల్లె , కడప | district = కడప | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | studnets = ఇరవై ఆరు మంది | faculty = ఒక }}
కడప జిల్లాలో సాంబేపల్లి పరిధిలో సెట్టిపల్లె గ్రామం నందు ఈ పాఠశాల ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28204700620. ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇక్కడ విద్యార్థులు ఐదవ తరగతి వరకూ విద్యని అభ్యసించవచ్చు. ఇక్కడ తెలుగు మాధ్యమంలో పాఠాలు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. ఈ పాఠశాల లో మొత్తం ఇరవై ఆరు మంది విద్యార్థులు చదువుతున్నారు. వీరిలో పదకొండు మంది బాలురు పదునయిదు మంది బాలికలు ఉన్నారు. ఇది ఒక ఏకోపాధ్యాయ పాఠశాల. ఒక ఉపాధ్యాయిని ఉన్నారు. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
