{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( డిపిపి) బీఎస్సార్ నగరం, ఎన్డీకే | city = నందిని కొట్కూర్ , కుర్నూల్ | district = కుర్నూల్ | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు, ఇంగ్లీష్ | studnets = అరవై రెండు మంది | faculty = ముగ్గురు }}
ఈ పాఠశాల కుర్నూల్ జిల్లాలో నందికొట్కూరు పరిధిలో గల నందిని కొట్కూర్ గ్రామము నందు ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28210800903. ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో ఈ పాఠశాల ఉన్నది. ఇక్కడ విద్యార్థులు ఐదవ తరగతి వరకూ విద్యని అభ్యసించవచ్చు. తెలుగు, ఇంగ్లీష్ మాధ్యమంలో ఇక్కడ పాఠములు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. మొత్తం అరవై రెండు మంది విద్యార్థులలో ముప్పై మూడు మంది బాలురు ఇరవై తొమ్మిది మంది బాలికలు ఈ పాఠశాల లో చదువుతున్నారు. ఇక్కడ మొత్తం ముగ్గురు ఉపాధ్యాయులు ఉన్నారు. వీరిలో ఒక ఉపాధ్యాయులు ఇద్దరు ఉపాధ్యాయినులు ఉన్నారు. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
