{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) కెమ్మూమియాపెట్ ( అమ్మాయిలు) | city = కెమ్మూమైహాపేట , కడప | district = కడప | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = ఇంగ్లీష్, తెలుగు | studnets = 270 మంది | faculty = పదహారు మంది }}
ఈ పాఠశాల కడప జిల్లాలో కుద్దాపాః పరిధిలో గల కెమ్మూమైహాపేట గ్రామము నందు ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28203190221. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యాబోధన కలదు. ఇంగ్లీష్, తెలుగు మాధ్యమంలో ఇక్కడ పాఠములు బోధిస్తారు. బాలికలకు మాత్రమే ఇక్కడ ప్రవేశం ఉన్నది. ఇక్కడ చదువుతున్న బాలికల సాంఖ్య 270. ఇక్కడ పదహారు మంది ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
