{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( లేదు.2) థోకాడ | city = థోకాడ , ఈస్ట్ గోదావరి | district = ఈస్ట్ గోదావరి | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | studnets = నలభై మంది | faculty = ఒక }}
