{{Infobox school | name = కస్తూర్బా గాంధీ బాలికా విద్యాలయ (KGBV) క్రిష్ణగైరి | city = క్రిష్ణగైరి , కుర్నూల్ | district = కుర్నూల్ | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = ఇంగ్లీష్ | studnets = 212 మంది | faculty = తొమ్మిది మంది }}
ఈ పాఠశాల క్రిష్ణగైరి గ్రామంలో ఉన్నది. కుర్నూల్ జిల్లా నందు క్రిష్ణగైరి పరిధిలో ఈ గ్రామం ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28212800505. ఇది కేజీబీవీలు ( ఎస్ఎస్ఏ) నిర్వహణలో పని చేస్తుంది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యాబోధన కలదు. ఇంగ్లీష్ మాధ్యమంలో ఇక్కడ పాఠాలు బోధిస్తారు. బాలికలకు మాత్రమే ఇక్కడ ప్రవేశం ఉన్నది. ఇక్కడ 212 మంది బాలికలు చదువుతున్నారు. ఇక్కడ తొమ్మిది మంది ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
