{{Infobox school | name = మండల ప్రజా పరిషత్ ప్రాథమిక పాఠశాల (MPPS) ( సీపీ) వెంటూరు | city = వెంటూరు , ఈస్ట్ గోదావరి | district = ఈస్ట్ గోదావరి | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 5 | medium = తెలుగు | studnets = ఇరవై మూడు మంది | faculty = ఇద్దరు }}
ఈ పాఠశాల వెంటూరు గ్రామంలో ఉన్నది. ఈస్ట్ గోదావరి జిల్లా నందు రాయవరం పరిధిలో ఈ గ్రామం ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28144000805. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులు ఐదవ తరగతి వరకూ విద్యని అభ్యసించవచ్చు. తెలుగు మాధ్యమంలో ఇక్కడ పాఠములు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. ఈ పాఠశాల లో మొత్తం ఇరవై మూడు మంది విద్యార్థులు చదువుతున్నారు. వీరిలో పది మంది బాలురు పదమూడు మంది బాలికలు ఉన్నారు. ఇక్కడ ఒక ఉపాధ్యాయులు ఒక ఉపాధ్యాయినులే, మొత్తం ఇద్దరు ఉపాధ్యాయులు ఉన్నారు. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
