{{Infobox school | name = జిల్లా పరిషత్ ఉన్నత పాఠశాల (ZPHS) విజెపిహెచ్ ఎస్ మోదుకూరు | city = మోదుకూరు , గుంటూరు | district = గుంటూరు | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 6 - 10 | medium = తెలుగు, ఇంగ్లీష్ | studnets = 272 మంది | faculty = పదునయిదు మంది }}
ఈ పాఠశాల మోదుకూరు గ్రామంలో ఉన్నది. గుంటూరు జిల్లా నందు తుసుందూరు పరిధిలో ఈ గ్రామం ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28173301206. ఇది ఎంపీపీ జెడ్పీపీ పాఠశాలలు నిర్వహణలో పని చేస్తుంది. ఇందులో ఆరవ తరగతి నుండి పదవ తరగతి వరకు విద్యాబోధన కలదు. ఇక్కడ తెలుగు, ఇంగ్లీష్ మాధ్యమంలో పాఠాలు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. ఇక్కడ 143 మంది బాలురు 129 మంది బాలికలు, మొత్తం 272 మంది విద్యార్థులు చదువుతున్నారు. ఇక్కడ మొత్తం పదునయిదు మంది ఉపాధ్యాయులు ఉన్నారు. వీరిలో పదకొండు మంది ఉపాధ్యాయులు నలుగురు ఉపాధ్యాయినులు ఉన్నారు. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
