{{Infobox school | name = ఆర్.సి.ఎం యూపీ, క్రిస్టరాజపురం | city = విజయవాడ ( కార్ప్.) -2 , కృష్ణ | district = కృష్ణ | state = ఆంధ్రప్రదేశ్ | country = భారతదేశము | grades = 1 - 8 | medium = తెలుగు | studnets = 154 మంది | faculty = ఆరుగురు }}
ఇది ఒక ప్రైవేటు ఎయిడెడ్ పాఠశాల. ఈ పాఠశాల కృష్ణ జిల్లాలో విజయవాడ అర్బన్ పరిధిలో గల విజయవాడ ( కార్ప్.) -2 గ్రామము నందు ఉన్నది. ఈ పాఠశాల యొక్క ఏకీకృత జిల్లా సమాచార విద్యా వ్యవస్థ ([http://udise.in/ U-DISE]) కోడ్ 28161790898. ఇది ప్రైవేట్.సహాయక నిర్వహణలో పని చేస్తుంది. ఇక్కడ విద్యార్థులు ఎనిమిదవ తరగతి వరకూ విద్యని అభ్యసించవచ్చు. ఇక్కడ తెలుగు మాధ్యమంలో పాఠములు బోధిస్తారు. ఇది ఒక బాల బాలికల పాఠశాల. మొత్తం 154 మంది విద్యార్థులలో డెబ్బై ఎనిమిది మంది బాలురు డెబ్బై ఆరు మంది బాలికలు ఈ పాఠశాల లో చదువుతున్నారు. ఇక్కడ ఆరుగురు ఉపాధ్యాయులు ఉన్నారు, వీరిలో అందరూ ఉపాధ్యాయినులే. <ref>{{cite web |title =School Directory |url =http://udise.in/school_directory.htm |website = udise.in }}</ref>. ఈ వివరములు నేషనల్ యూనివర్శిటీ ఆఫ్ ఎడ్యుకేషనల్ ప్లానింగ్ అండ్ అడ్మినిస్ట్రేషన్ ([https://www.indiaeducation.net/apexbodies/nuepa/ NUEPA]) జరిపిన సర్వే ఆధారముగా 2011-12 విద్యా సంవత్సరమునకు సంబంధించినవి.
